sections.code:
body,
#content,
#mw-head,
#mw-page-base {
    background: #F8F5F4 !important;
}

#toc,
.infobox,
.thumbinner,
#mw-content-text > div > table {
    background: #EBE3E1 !important;
}

.mw-body-content {
    font-family: Baskerville, serif;
    font-size: 1.35em;
    line-height: 1.3;
}

.mw-body-content p {
    margin: 0.75em 0;
}

pre, code {
    font-size: 0.8em;
    background: #EBE3E1;
    border-radius: 5px;
}

h1,
h2,
h3,
h4,
h5,
h6 {
    border-bottom: none;
    font-family: Baskerville, serif !important;
}

#content {
    border: none;
    margin: auto 20%;
}

#mw-panel {
    display: none;
}

#p-personal,
#left-navigation,
#p-views {
    display: none;
}

#p-navigation,
#p-interaction,
#p-tb,
#p-wikibase-otherprojects,
#p-coll-print_export {
    display: none;
}

body {
    font-size: 1.35em;
    font-family: Baskerville, serif;
    background: #F8F5F4;
    color: #232323;
}

h1,
h2,
h3,
h4,
h5 {
    font-family: Baskerville, serif;
    font-weight: bold;
}

.unruled a {
   font-size: 1.25em !important;
}

dl dt,
dl dd {
    font-size: 1.15em;
}

p {
    line-height: 1.1em;
}

#page {
    max-width: 61.8%;
    margin: auto;
}

pre, code {
    background: #EBE3E1;
    font-family: Monospace;
    font-size: 0.95em;
}

code {
    border-radius: 3px;
    padding: 1px 3px;
    margin: 0px 2px 0px 2px;
}

p,
li {
    max-width: 100%
}

div.content, div.transcript, div.check-yourself {
    width: 800px;
}

iframe {
    width: 800px;
    height: 640px;
}

